import React from 'react';

const FacialRecognition = ({ imageUrl }) => {
    return (
        <div className='center ma'>
            <div className='absolute mt2'>
                <img alt='submitted' src={imageUrl} width='500px' height='auto'/>
            </div>
        </div>
    )
}

export default FacialRecognition;
